import { Link } from "react-router-dom";

function AllBags() {
  return (
    <div className="zipper">
      <Link to="/gymbag">
        <img className="bag-image" src="gymbag.jpg" alt="Gym Bag" />
      </Link>
      <Link to="/casualbag">
        <img className="bag-image" src="casualbag.jpg" alt="Casual Bag" />
      </Link>
      <Link to="/daypack">
        <img className="bag-image" src="daypack.jpg" alt="Day Pack" />
      </Link>
      <Link to="/fannypack">
        <img className="bag-image" src="fannypack.jpg" alt="Fanny Pack" />
      </Link>
    </div>
  );
}

export default AllBags;
